def crop(QiGuan_Return):
    if 'left' == QiGuan_Return['fei_loca_info0'][0]:
        left_lung_seg_tuple = QiGuan_Return['fei_loca_info0'][1]
        right_lung_seg_tuple = QiGuan_Return['fei_loca_info1'][1]
    else:
        right_lung_seg_tuple = QiGuan_Return['fei_loca_info0'][1]
        left_lung_seg_tuple = QiGuan_Return['fei_loca_info1'][1]
    
    
    left_lung_contour = np.array([[list(item)] for item in left_lung_seg_tuple])
    right_lung_contour = np.array([[list(item)] for item in right_lung_seg_tuple])

    left_lung_contour = left_lung_contour.reshape((left_lung_contour.shape[0], left_lung_contour.shape[2]))
    right_lung_contour = right_lung_contour.reshape((right_lung_contour.shape[0], right_lung_contour.shape[2]))

    top_point = left_lung_contour[np.where(left_lung_contour[:,1] == np.min(left_lung_contour[:,1]))]
    top_point = top_point[np.where(top_point[:,0] == np.max(top_point[:,0]))][0]

    left_point = left_lung_contour[np.where(left_lung_contour[:,0] == np.min(left_lung_contour[:,0]))]
    left_point = left_point[np.where(left_point[:,1] == np.max(left_point[:,1]))][0]

    right_point = [int(left_point[0] + round((top_point[0] - left_point[0])*1.5)), left_point[1]]

    sel_y = min(left_lung_contour[:,1], key=lambda x:abs(x-np.quantile(left_lung_contour[:,1], 0.65)))
    mid_point = left_lung_contour[np.where(left_lung_contour[:,1] == sel_y)]

    # print('mid_point', mid_point)
    end_point = [top_point[0], list(set(mid_point[:,1]))[0]]    

    d_top_end = end_point[1] - top_point[1]
    left_top_corner = [right_point[0] - d_top_end, top_point[1]]
    right_bottom_corner = [right_point[0], end_point[1]]

    return left_top_corner, right_bottom_corner


